    def diagnostico_sifilis_estagio1(self, sintomas):
        MUDA_DEZ = 10
        MUDA_VINTE = 20
        MUDA_TRINTA = 30
        MUDA_QUARENTA = 40

        # ==============================================================================================================#
        # ====================================== Antecedentes e Conseqquentes ==========================================#
        # ==============================================================================================================#
        ultima_relacao_sexual_vaginal = ctrl.Antecedent(np.arange(0, 90, self.acuracia),'ultima_relacao_sexual_vaginal')
        ultima_relacao_sexual_oral = ctrl.Antecedent(np.arange(0, 90, self.acuracia), 'ultima_relacao_sexual_oral')
        ultima_relacao_sexual_anal = ctrl.Antecedent(np.arange(0, 90, self.acuracia), 'ultima_relacao_sexual_anal')

        ferida_genitalia = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia),'ferida_genitalia')
        ingua_virilha = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia),'ingua_virilha')

        possibilidade_sifilis_estagio1 = ctrl.Consequent(np.arange(LabelDoencas.NENHUMA.value, LabelDoencas.MUITO_ALTA.value, self.acuracia), 'possibilidade_sifilis_estagio1', defuzzify_method = self.in_met_defuzz)

        # ==============================================================================================================#
        # ====================================== Funções das Variáveis =================================================#
        # ==============================================================================================================#
        # Ultima relaação sexual vaginal
        ultima_relacao_sexual_vaginal['INSUFICIENTE'] = fuzz.trimf(ultima_relacao_sexual_vaginal.universe, [0, 0, 3])
        ultima_relacao_sexual_vaginal['SUFICIENTE'] = fuzz.trapmf(ultima_relacao_sexual_vaginal.universe, [0, 3, 60, 90])
        ultima_relacao_sexual_vaginal['INSUFICIENTE_ALTO'] = fuzz.trimf(ultima_relacao_sexual_vaginal.universe,[60, 90, 90])

        # Ultima relaação sexual anal
        ultima_relacao_sexual_anal['INSUFICIENTE'] = fuzz.trimf(ultima_relacao_sexual_anal.universe, [0, 0, 3])
        ultima_relacao_sexual_anal['SUFICIENTE'] = fuzz.trapmf(ultima_relacao_sexual_anal.universe, [0, 3, 60, 90])
        ultima_relacao_sexual_anal['INSUFICIENTE_ALTO'] = fuzz.trimf(ultima_relacao_sexual_anal.universe, [60, 90, 90])

