        ultima_relacao_sexual_oral['SUFICIENTE'] = fuzz.trapmf(ultima_relacao_sexual_oral.universe, [0, 3, 60, 90])
        ultima_relacao_sexual_oral['INSUFICIENTE_ALTO'] = fuzz.trimf(ultima_relacao_sexual_oral.universe, [60, 90, 90])

