        vomito = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia),'vomito')
        convulsoes = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia),'convulsoes')
        delirios = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia),'delirios')

        possibilidade_sifilis_estagio3 = ctrl.Consequent(np.arange(LabelDoencas.NENHUMA.value, LabelDoencas.MUITO_ALTA.value, self.acuracia), 'possibilidade_sifilis_estagio3', defuzzify_method = self.in_met_defuzz)
        
