    def diagnostico_cancro_mole(self, sintomas):
        MUDA_DEZ = 10
        MUDA_VINTE = 20
        MUDA_TRINTA = 30
        MUDA_QUARENTA = 40

        # ==============================================================================================================#
        # ====================================== Antecedentes e Conseqquentes ==========================================#
        # ==============================================================================================================#
        ultima_relacao_sexual_vaginal = ctrl.Antecedent(np.arange(0, 30, self.acuracia),'ultima_relacao_sexual_vaginal')
        ultima_relacao_sexual_oral = ctrl.Antecedent(np.arange(0, 30, self.acuracia), 'ultima_relacao_sexual_oral')
        ultima_relacao_sexual_anal = ctrl.Antecedent(np.arange(0, 30, self.acuracia), 'ultima_relacao_sexual_anal')

        feridas_pequenas_com_pus = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia), 'feridas_pequenas_com_pus')
        ingua_virilha = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia), 'ingua_virilha')
        dor_genitalia = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia), 'dor_genitalia')
        dor_urinar = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia), 'dor_urinar')

        possibilidade_cancro_mole = ctrl.Consequent(np.arange(LabelDoencas.NENHUMA.value, LabelDoencas.MUITO_ALTA.value, self.acuracia), 'possibilidade_cancro_mole', defuzzify_method = self.in_met_defuzz)

        # ==============================================================================================================#
        # ====================================== Funções das Variáveis =================================================#
        # ==============================================================================================================#
