        ultima_relacao_sexual_vaginal = ctrl.Antecedent(np.arange(0, 35, self.acuracia), 'ultima_relacao_sexual_vaginal')

        corrimento_anormal = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia), 'corrimento_anormal')
        dor_durante_relacao_sexual = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia), 'dor_durante_relacao_sexual')
        dor_urinar = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia), 'dor_urinar')
        coceira_genitalia = ctrl.Antecedent(np.arange(LabelSintomas.NENHUMA.value, LabelSintomas.ALTA.value, self.acuracia), 'coceira_genitalia')

        possibilidade_tricomoniase = ctrl.Consequent(np.arange(LabelDoencas.NENHUMA.value, LabelDoencas.MUITO_ALTA.value, self.acuracia), 'possibilidade_tricomoniase', defuzzify_method = self.in_met_defuzz)

