        ultima_relacao_sexual_vaginal['INSUFICIENTE'] = fuzz.trimf(ultima_relacao_sexual_vaginal.universe, [0, 0, 10])
        ultima_relacao_sexual_vaginal['SUFICIENTE'] = fuzz.trapmf(ultima_relacao_sexual_vaginal.universe,[0, 10, 25, 35])
